To define a struct, we enter the keyword struct and name the entire struct. A struct’s name should describe the significance of the pieces of data being grouped together. Then, inside curly brackets, we define the names and types of the pieces of data, which we call fields. The following example shows a struct that stores information about a user account. struct User { username: string, email: string, sign_in_count: int, active: bool,
} Structs can be nested as a type inside other structs. For example, we could assign each user an address, which itself is a struct. struct Address { street: string, number: int postal_code: string, city: string
} struct User { username: string, email: string, address: Address
}

